import socket from '../utils/socket';
export default {
  data() {
    return {
      loading: false,
      loadingText: '呼叫中',
      isJoin: false,
      account: window.sessionStorage.account || '',
      isToPeer: false,
      // 是否立即建立P2P连接
      roomid: window.sessionStorage.roomid || ''
    };
  },

  components: {},
  methods: {
    join() {
      if (!this.account) return;
      this.isJoin = true;
      window.sessionStorage.account = this.account;
      socket.emit('join', {
        account: this.account,
        roomid: this.roomid
      });
    }

  }
};
